import React from "react";
import "./navbar.css";
import { useSelector } from "react-redux";

export default function Navbar() {
  const userName = localStorage.getItem("username");
  const isAuthenticated = useSelector((store) => store.auth.isAuthenticated);
  return (
    <nav className="navContainer">
      <div className="left-nav">
        <a href="/home">Photo</a>
        <a href="/search/category1/empty">category1</a>
        <a href="/search/category2/empty">category2</a>
        <a href="/search/category3/empty">category3</a>
        <a href="/search/category4/empty">category4</a>
        <a href="/search/category5/empty">category5</a>
      </div>
      <div className="right-nav">
        <a href="/post">Post Item</a>
        <a href={isAuthenticated ? "/secret" : "/signup"}>
          {isAuthenticated ? "Signup": userName }
        </a>
      </div>
    </nav>
  );
}
